  return (
    <div
      className="bg-cover bg-center bg-no-repeat"
      style={{ backgroundImage: "url('/path/to/your/background-image.jpg')" }}
    >
      <div className="container mx-auto py-8">
        <div className="grid grid-cols-1 sm:grid-cols-2 md:grid-cols-4 gap-4">
          <div className="px-4">
            <h1 className=" text-yellow-600"> About Astrologer</h1>
            <div className=" text-yellow-600"></div>
            <p>
              as a loading and Famous Indain astrologer in New York USA,
              Shivanand ji offers reliable abd practical astrology solution to
              all the life problem. He is a Professional and well-educated
              Indian Vedic astrologer, with year of experience in the field of
              astrology.{" "}
            </p>
          </div>
          <div className="px-4">{/* Content for column 2 */}</div>
          <div className="px-4">{/* Content for column 3 */}</div>
          <div className="px-4">{/* Content for column 4 */}</div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
